    null,nt"notes": "BoundaryOther_SUNIONS was intended to provide outlines of
    all Vermont school supervisory unions for use in displaying demographic data pertinent
    to each union, and other comparitive statistics pertinent to these administrative
    units. The boundaries were created by providing each municipal jurisdiction in BoundaryTown_TB250
    with an attribute representing the supervisory union in which it participates, and
    then dissolving internal town boundaries within each supervisory union. Each SUNION
    is made up of contiguous BoundaryTown_TB250 polygons. There are some BoundaryTown_TB250
    polygons for which no SUNION is designated, because of their unpopulated nature.
    The list of municipalities participating in each SUNION was provided to VCGI by
    the office of the Commissioner of the Vermont Dept. of Education.",nt"owner_org":
